import React from 'react'
import {
  BrowserRouter as Router,
  Route,
  Routes,
} from 'react-router-dom';
import './App.css';
import {AboutMe} from './Pages/AboutMe.js';

function App() {
  return (
  <Router>
    <div className="App">
      <Routes>
        <Route path="/" element={<AboutMe/>}/>
        hi!
      </Routes>
    </div>
  </Router>
  );
}

export default App;
